import React, { useState, useEffect } from "react";

function getResultTag(source) {
  if (source === "cache") return "✅ Served from cache";
  if (source === "predicted") return "🔮 Served from predicted cache";
  if (source === "backend") return "🌐 Served via backend (cold miss)";
  return source;
}

function App() {
  const [query, setQuery] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [dashboard, setDashboard] = useState({ cache: [], last_10_hits: [], miss_rate: 0, predictions: [] });

  // Poll dashboard stats every 2 seconds
  useEffect(() => {
    const fetchDashboard = async () => {
      try {
        const res = await fetch("http://127.0.0.1:8000/dashboard");
        if (!res.ok) throw new Error();
        const data = await res.json();
        setDashboard(data);
      } catch {}
    };
    fetchDashboard();
    const interval = setInterval(fetchDashboard, 2000);
    return () => clearInterval(interval);
  }, []);

  const handleSearch = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setResult(null);
    try {
      const res = await fetch(`http://127.0.0.1:8000/search?query=${encodeURIComponent(query)}`);
      if (!res.ok) throw new Error("Backend error");
      const data = await res.json();
      setResult(data);
    } catch (err) {
      setError("Failed to fetch result");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="flex min-h-screen bg-gray-100">
      {/* Sidebar */}
      <aside className="w-80 bg-white p-4 shadow overflow-y-auto" style={{maxHeight: '100vh'}}>
        <h2 className="font-bold text-lg mb-4">CacheCraft Dashboard</h2>
        <div className="mb-4">
          <div className="font-semibold mb-1">Cache Entries</div>
          <ul className="text-xs">
            {dashboard.cache.length === 0 && <li className="text-gray-400">(empty)</li>}
            {dashboard.cache.map((item, i) => (
              <li key={i} className="mb-1 flex justify-between">
                <span>{item.query}</span>
                <span className="ml-2 text-gray-500">{item.source}</span>
                <span className="ml-2 text-blue-600">{item.expires_in}s</span>
              </li>
            ))}
          </ul>
        </div>
        <div className="mb-4">
          <div className="font-semibold mb-1">Predicted Next Queries</div>
          <ul className="text-xs">
            {(!dashboard.predictions || dashboard.predictions.length === 0) && <li className="text-gray-400">(none)</li>}
            {dashboard.predictions && dashboard.predictions.map((pred, i) => (
              <li key={i} className="mb-1 flex justify-between">
                <span>{pred.query}</span>
                <span className="ml-2 text-blue-600">{(pred.confidence * 100).toFixed(0)}%</span>
              </li>
            ))}
          </ul>
        </div>
        <div className="mb-4">
          <div className="font-semibold mb-1">Last 10 Hits</div>
          <ul className="text-xs">
            {dashboard.last_10_hits.length === 0 && <li className="text-gray-400">(none)</li>}
            {dashboard.last_10_hits.map((hit, i) => (
              <li key={i} className="mb-1 flex justify-between">
                <span>{hit.query}</span>
                <span className="ml-2 text-gray-500">{hit.source}</span>
              </li>
            ))}
          </ul>
        </div>
        <div className="mb-2">
          <span className="font-semibold">Cache Miss Rate:</span> <span className="text-blue-600">{(dashboard.miss_rate * 100).toFixed(1)}%</span>
        </div>
      </aside>
      {/* Main */}
      <main className="flex-1 p-8">
        <form onSubmit={handleSearch} className="mb-6">
          <input
            className="border p-2 rounded w-80"
            placeholder="Search..."
            value={query}
            onChange={e => setQuery(e.target.value)}
          />
          <button className="ml-2 px-4 py-2 bg-blue-600 text-white rounded" type="submit" disabled={loading}>Search</button>
        </form>
        {loading && <div className="mb-4 text-blue-600">Loading...</div>}
        {error && <div className="mb-4 text-red-600">{error}</div>}
        {result && (
          <div className="bg-white p-4 rounded shadow">
            <div className="font-bold">{result.result}</div>
            <div className="text-xs mt-2">{getResultTag(result.source)}</div>
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
